import React, { useState } from 'react';
import Navigation from '../navigation/Navigation';
const Calculatrice = () => {
    const [nombre, setNombre] = useState(1)
    const ajouter = () => {
        setNombre(nombre + 1)
    }
    return (
        <div>
            <h3>Calculatrice</h3>
            <Navigation />
            <p>incrementation</p>
            <p>counteur:{nombre} <button onClick={ajouter}>Ajouter +1</button></p>
        </div>
    );
};

export default Calculatrice;
